												{t('Enrolled')}
											</TableCell>
											<TableCell
												className="px-0"
												colSpan={1}>
												{t('Action')}
											</TableCell>
										</TableRow>
									</TableHead>
									<TableBody>
										{this.productList.map((product, index) => (
											<TableRow key={index}>
												<TableCell
													className="px-0 capitalize"
													colSpan={4}
													align="left">
													<div className="flex flex-middle">
														<img
															className="circular-image-small"
															src={product.imgUrl}
															alt="user"
														/>
														<p className="m-0 ml-8">{product.name}</p>
													</div>
												</TableCell>
												<TableCell
													className="px-0 capitalize"
													align="left"
													colSpan={2}>
													$
													{product.price > 999
														? (product.price / 1000).toFixed(1) + 'k'
														: product.price}
												</TableCell>

												<TableCell
													className="px-0"
													align="left"
													colSpan={2}>
													{product.available ? (
														product.available < 20 ? (
															<small className="border-radius-4 bg-secondary text-white px-8 py-2 ">
																{product.available}
															</small>
														) : (
															<small className="border-radius-4 bg-primary text-white px-8 py-2 ">
																{product.available}
															</small>
														)
													) : (
														<small className="border-radius-4 bg-error text-white px-8 py-2 ">
															{product.available}
														</small>
													)}
												</TableCell>
												<TableCell
													className="px-0"
													colSpan={1}>
													<a href={product.link}>
														<IconButton>
															<Icon color="secondary">play_circle_filled</Icon>
														</IconButton>
													</a>
												</TableCell>
											</TableRow>
										))}
									</TableBody>
								</Table>
							</div>
						</Card>
					</Grid>

					<Grid
						item
						lg={4}
						md={4}
						sm={12}
						xs={12}>
						<Card
							style={{}}
							elevation={6}
							className="p-sm-24 h-100">
							<Card
								elevation={0}
								className="upgrade-card bg-light-primary p-sm-24 mb-36">
								<img
									src={
										ConstantList.ROOT_PATH +
										'assets/images/illustrations/upgrade.svg'
									}
									alt="upgrade"
								/>
								<p className="text-muted m-0 py-24">{t('never give up')}</p>
							</Card>

							<div className="mb-36">
								<h5 className="mb-16 font-size-14 font-weight-600 text-hint">
									Achievements
								</h5>
								<div className="flex flex-middle">
									<Tooltip
										title="Completed first course"
										placement="top">
										<img
											src={
												ConstantList.ROOT_PATH +
												'assets/images/badges/badge-1.svg'
											}
											alt="badge"
											height="24px"
										/>
									</Tooltip>
									<Tooltip
										title="Won a challenge"
										placement="top">
										<img
											className="mx-24"
											src={
												ConstantList.ROOT_PATH +
												'assets/images/badges/badge-2.svg'
											}
											alt="badge"
											height="24px"
										/>
									</Tooltip>
									<Tooltip
										title="Won a competition"
										placement="top">
										<img
											src={
												ConstantList.ROOT_PATH +
												'assets/images/badges/badge-3.svg'
											}
											alt="badge"
											height="24px"
										/>
									</Tooltip>
								</div>
							</div>

							<div className="">
								<h5 className="mb-8 font-size-14 font-weight-600 text-hint">
									{t('forum statistic')}
								</h5>
								<EgretListItem1
									title={t('number of members')}
									subtitle="2606"
									bulletIcon="web"
									iconColor="error"
									actionIcon="play_circle_outline"></EgretListItem1>

								<EgretListItem1
									title={t('online')}
									subtitle="2000"
									bulletIcon="list_alt"
									iconColor="primary"
									actionIcon="play_circle_outline"></EgretListItem1>

								<EgretListItem1
									title={t('number of posts')}
									subtitle="2022"
									bulletIcon="description"
									iconColor="secondary"
									actionIcon="play_circle_outline">
									{this.state.postList.countResult}
								</EgretListItem1>
							</div>

							<Card
								style={{
									marginTop: '100px',
									display: 'flex',
									justifyContent: 'center',
								}}
								elevation={0}
								className="upgrade-card bg-light-primary p-sm-24 mb-36">
								<div className="pie">
									<PieChart
										width={400}
										height={400}>
										<Pie
											data={data}
											cx="50%"
											cy="50%"
											labelLine={false}
											label={renderCustomizedLabel}
											outerRadius={80}
											fill="#8884d8"
											dataKey="value">
											{data.map((entry, index) => (
												<Cell
													key={`cell-${index}`}
													fill={COLORS[index % COLORS.length]}
												/>
											))}
										</Pie>
										<Legend
											iconSize={10}
											layout="vertical"
											verticalAlign="top"
										/>
									</PieChart>
								</div>
							</Card>

							<Card
								style={{ marginTop: '100px' }}
								elevation={6}
								className="mb-24">
								<EducationChart height="400px"></EducationChart>
							</Card>
						</Card>
					</Grid>
				</Grid>
			</div>
		);
	}
}

export default Forum;
